    17,nt"tags": [],nt"title": "Deoxyribonucleic acid (DNA), AMMONIUM, CHLOROPHYLL
    C, FLUORESCENCE and other profile, underway - surface and discrete sample data collected
    in the North Pacific Ocean on the RANGE RECOVERER, THOMAS G. THOMPSON and WECOMA
    cruises R0208, T0205 and others as part of the NEP project from 2000-05-30 to 2002-08-19
    (NODC Accession 0115199)",nt"tracking_summary": {ntt"total": 6,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-09-27T01:52:27.445620",nt"name": "deoxyribonucleic-acid-dna-ammonium-chlorophyll-c-fluorescence-and-other-profile-underway-surfa",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115199 includes profile,
    underway - surface, discrete sample, biological, physical and chemical data collected
    aboard the RANGE RECOVERER, THOMAS G. THOMPSON and WECOMA during cruises R0208,
    T0205, W0005A and W0008 in the North Pacific Ocean from 2000-05-30 to 2002-08-19.
    These data include Deoxyribonucleic acid (DNA), AMMONIUM, CHLOROPHYLL C, FLUORESCENCE,
    NITRATE, fucoxanthin, SALINITY, NITRITE, BACTERIA, CAROTENOIDS - PLANT, PHAEOPIGMENTS,
    Synechococcus, diatom, PHYTOPLANKTON, NITRATE + NITRITE CONTENT (CONCENTRATION),
    WATER TEMPERATURE, SILICATE, Diadinoxanthin, HPLC PIGMENTS, CHLOROPHYLL A, PHOSPHATE,
    Eukaryote, Violaxanthin, monadoxanthin, CHLOROPHYLL B and Alloxan (or alloxantin).
    The instruments used to collect these data include CTD, fluorometer, Optical Spectrometer,
    Fast Repetition Rate Fluorometer and Slowdrop optical profiler / CTD. These data
    were collected by Ricardo Letelier of Oregon State University as part of NEP. The
    Biological and Chemical Oceanography Data Management Office (BCO-DMO) submitted
    these data to NODC on 2013-10-30.nnThe following is the text of the abstract provided
    by BCO-DMO:nnPhytoplankton, HPLC, flow cytometry, and nutrient data were collected
    by SLOWDROP optical profilers, underway, and CTD's. SLOWDROP optical profilers provided
    high resolution vertical profiles of temperature, salinity, and density along with
    bio-optical properties. The underway component focused on the assessment of the
    spatial and temporal variability in phytoplankton biomass and physiology. Discrete
    samples for chlorophyll fluorometric determinations, pigment analyis, partical absorption,
    and nutrients were collected by CTD cast.",nt"license_title": null,nt"extras":
